import { ScFile, ScNodeType } from '@source-craft/types';
import camelCase from 'lodash-es/camelCase';
import kebabCase from 'lodash-es/kebabCase';
import upperFirst from 'lodash-es/upperFirst';
import snakeCase from 'lodash-es/snakeCase';

export const elementsMd = ({packageName, moduleNamePluralTitleCase, _kebab, kebabSingular_, moduleNamePlural, moduleName}: {packageName: string; moduleNamePluralTitleCase: string; _kebab: string; kebabSingular_: string; moduleNamePlural: string; moduleName: string;}): ScFile => ({
  type: ScNodeType.File,
  content: `# Frontend Docs >> Elements ||10

To add one of these elements to your web-app, import it like this:

\`\`\`js
import "${packageName}/agent-avatar";
\`\`\`

Keep in mind that these elements should be placed inside a \`<context-provider>\` that provides an initialized \`${moduleNamePluralTitleCase}Store\`, associated with the \`${moduleNamePlural}StoreContext\` context . Follow the [Adding the UI](../setting-up/adding-the-frontend.md) guide to get started, or read [this to know more about the context pattern](https://holochain-open-dev.github.io/reusable-modules/frontend/using#Context).

Click on the selector on the right to look at all the elements available.

\`\`\`js story
import { html } from "@mdjs/mdjs-preview";
import "api-viewer-element";
import "${packageName}/create${_kebab}";
import "${packageName}/search-agent";
import "${packageName}/list${_kebab}s";
import "${packageName}/${kebabSingular_}detail";
import "${packageName}/my${_kebab}";
import "${packageName}/update${_kebab}";
import "${packageName}/holo-identicon";
import "${packageName}/agent-avatar";
import "${packageName}/${kebabSingular_}prompt";
import "@holochain-open-dev/context/context-provider";
import { ${moduleNamePluralTitleCase}ZomeMock } from "${packageName}/mocks";
import {
  ${moduleNamePlural}StoreContext,
  ${moduleNamePluralTitleCase}Store,
} from "${packageName}";

const store = new ${moduleNamePluralTitleCase}Store(
  new ${moduleNamePluralTitleCase}ZomeMock([
    {
      agentPubKey: "uhCAk8OKb2hznzG023xxh_vR3Q7Y4IEOAo4B0QN7ZhbGYeww",
      ${moduleName}: {
        nickname: "Alice",
        fields: {
          location: "Wonderland",
          avatar:
            "data:image/png;base64,",
        },
      },
    },
    {
      agentPubKey: "uhCAkSEspAJks5Q8863Jg1RJhuJHJpFWzwDJkxVjVSk9JueU",
      ${moduleName}: {
        nickname: "Bob",
        fields: {
          location: "Castle",
          avatar:
            "data:image/png;base64,",
        },
      },
    },
  ]),
  {
    additionalFields: ["Location"],
  }
);

let src = "/_merged_assets/_static/custom-elements.json";
const isGhPages = !window.location.href.includes("localhost:");

if (isGhPages) {
  const components = window.location.href.split("/");
  src = \`/\${components[3]}\${src}\`;
}

export const foo = () => html\`
  <link
    href="https://fonts.googleapis.com/css?family=Material+Icons&display=block"
    rel="stylesheet"
  />

  <context-provider .context=\${${moduleNamePlural}StoreContext} .value=\${store}>
    <api-viewer src="\${src}" exclude-knobs="store" section="demo">
      <template data-element="agent-avatar" data-target="host">
        <agent-avatar
          agent-pub-key="uhCAkSEspAJks5Q8863Jg1RJhuJHJpFWzwDJkxVjVSk9JueU"
        ></agent-avatar>
      </template>
      <template data-element="${kebabSingular_}detail" data-target="host">
        <${kebabSingular_}detail
          agent-pub-key="uhCAkSEspAJks5Q8863Jg1RJhuJHJpFWzwDJkxVjVSk9JueU"
        ></${kebabSingular_}detail>
      </template>
      <template data-element="holo-identicon" data-target="host">
        <holo-identicon
          hash="uhCAkSEspAJks5Q8863Jg1RJhuJHJpFWzwDJkxVjVSk9JueU"
        ></holo-identicon>
      </template>

      <template data-element="${kebabSingular_}prompt" data-target="slot">
        <span
          >Here is where the rest of your application content should go</span
        >
      </template>
      <template data-element="search-agent" data-target="host">
        <search-agent style="margin-bottom: 80px"></search-agent>
      </template>
    </api-viewer>
  </context-provider>
\`;
\`\`\`
`
});
    